import React from 'react';

function Cards(prop){
  return(
    <div>
      <img src={prop.imgsrc}/>
      <h1>{prop.title}</h1>
      <h3>{prop.seriesName}</h3>
      <a src={prop.link}><button>Watch now</button></a>
    </div>
  )
}

export default Cards
